import React, { Component } from 'react';
import { BrowserRouter,Redirect,Route, Link } from 'react-router-dom';
import './App.css';

import BookList from './components/book/book';
import Book from './components/book/book';
import SignInForm from './components/sign_in';
import SingIn from './components/sign_in'


class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <React.Fragment className="App">
          <div className='header'>
            <Link  to='/book' className="link">Book Store Registration</Link>

          </div>

          <Route exact path='/signin' render={() => <SignInForm {...{signInAuthor: this.signInAuthor}} />} />



       <Route exact path='/' render={() => <Redirect to='/book' />} />
        <Book />
          <SingIn />

        </React.Fragment>
      </BrowserRouter>
    );
  }
}

export default App;
